import React, {Component} from 'react';
import {BrowserRouter, Switch} from 'react-router-dom'
import MainRouter from './MainRouter';
// const App = () => {

// }
class App extends Component {
  render() {
    return (
    <Switch>
      <BrowserRouter>
        <MainRouter/>
      </BrowserRouter>
    </Switch>
    )
  }
}

export default App;
